objet:
sensibiliser la population à la protection de l'environnement sur l'ile
de saint Barthélemy et saint Martin ainsi que l'organisation d'évènements artistiques, sportifs et culturelles
en lien avec la défense de l'environnement ;

gérer une école dont la formation et l'éducation et notamment la création et la gestion d'établissement scolaire, de tous centres ou locaux culturels ou sportifs annexes à cet objet, ainsi que tout ce qui, directement ou indirectement permet ou facilite la réalisation de son objet
proposer du soutien scolaire en dehors du temps scolaire ; développer et soutenir des projets pédagogiques tels que sport-étude ; approfondissement des langues étrangères   pour les élèves de l'école
d'organiser des rencontres, des ateliers ou des stages sur les thèmes de la parentalité, de la communication, de l'éducation et de pédagogies ;

sensibiliser au bien-être et la bientraitance des chiens et autres animaux domestiques de Saint-Barthélemy ; 
Sensibiliser et promouvoir les méthodes d'éducation positives et bienveillantes ; 
Mettre en place des activités canines plein air ; 
Mettre en place des suivis pédagogiques en éducation, rééducation et adoption ; 
Mettre en place des activités économiques axées sur la vente de produits et d'accessoires conçus pour le bien-être du chien ; 
Mettre en place des réglementations sur les randonnées humaines et canines de l'île ; 
Informer et former les professionnels canins déjà présents et à en devenir en éducation positive et bienveillante ; 
Faire de la prévention dans les écoles ; 
Aider et soutenir les personnes et les organismes soucieux du bien-être animal déjà actifs et à en devenir, sur l'île et celles aux alentours ;
